def get_sol(): return Solution()
class Solution:
    # bucket sort
    def maxIceCream(self, costs: List[int], coins: int) -> int:
        MAX = 10**5+1
        buckets=[0]*MAX
        for i in range(len(costs)):
            buckets[costs[i]]+=1
        res = 0
        i=0
        while i<MAX:
            if buckets[i]*i >= coins: # use all coins
                res += coins//i
                return res
            else:
                coins -= buckets[i]*i
                res += buckets[i]
            i+=1
        return res
